import React, { Fragment } from 'react';
import EmployeeList from './components/EmployeeList';
import Search from './components/Search';
import Nav from './components/Nav';
import './App.css';

const App = () => {
  return (
    <Fragment>
      <Nav />

      <Search />
      <div className='main-container'>
        <EmployeeList />
      </div>
    </Fragment>
  );
};

export default App;
